      setSelected(index);
    };
    
  return (
    <div className={styles.navbar}>
      <div className={styles.item}>
        <Link to="/stars">Второе задание</Link>
      </div>
      <div className={styles.item}>
        <Link to="/tags">Третье задание</Link>
      </div>
      <div className={styles.item}>
        <Link to="/pagination">Четвертое задание</Link>
      </div>
    </div>
  );
};

